import s from "./CardPay.module.css"

const CardPay = () => {
  return (
    <div>
      <p>Credit Card Payment</p>
      <div className={s.wrapper}>

      <input id="name" name="name" className={s.fullInput} />

      <input id="number" name="number" type="number" className={s.fullInput} />
      <div className={s.group}>

      <input id="expiry" name="expiry" />
      <input />

      <input id="cvv" name="cvv" />
      </div>
      </div>
    </div>
  );
};

export default CardPay;
